export default function App() {
  return (
    <div className="App">
      <Navbar />
    </div>
  );
}

function Navbar() {
  return (
    <header className="container md:flex md:flex-row">
      <div>
        <img src="images/logo.png" alt="Logo PetMeeting" width={400} />
      </div>
      <nav className="container md:flex md:flex-row mx-auto md:h-12 md:mb-1">
        <ul className="flex-col p-6 max-w-max mx-aut text-blue-400 m-0 md:flex md:flex-row md:pt-0">
          <li className="md:mt-3 md:mr-6 lg:mr-12 text-center hover:text-blue-500">ANNONCES</li>
          <li className="md:mt-3 md:mr-6 lg:mr-12 text-center hover:text-blue-500">PUBLIER</li>
          <li className="md:mt-3 md:mr-6 lg:mr-12 text-center hover:text-blue-500">MEMBRES</li>
          <li className="md:mt-3 md:mr-6 lg:mr-12 text-center hover:text-blue-500">CONTACT</li>
        </ul>
      </nav>
    </header>
  );
}
